import { Component } from '@angular/core';


import { MensajesComponent } from '../mensajes/mensajes.component';
import { Mensajes } from '../mock-mensaje';
@Component({
  selector: 'app-reparto',
  templateUrl: './reparto.component.html',
  styleUrls: ['./reparto.component.css']
})
export class RepartoComponent {
  public _mensaje: MensajesComponent
  public mensajes = Mensajes
  constructor(){
    this._mensaje = new MensajesComponent
    this.mensajes = Mensajes
  }
  
}
<div *ngIf="mensajes[1].titulo=='HAY ERROR'" class="exito">
    <h2>{{mensajes[0].titulo}}</h2>
    <p>{{mensajes[0].description}}</p>
  </div>
  <div *ngIf="mensajes[1].titulo=='HAY ERROR'" class="error">
    <h2>{{mensajes[1].titulo}}</h2>
    <p>{{mensajes[1].description}}</p>
  </div>
<p></p>
